import {
  Dvr,
  Apartment,
  MedicalServices,
  School,
  Assessment,
} from "@mui/icons-material";

const pages = [
  {
    id: "digitalization",
    title: "Цифровізація",
    type: "collapse",
    icon: <Dvr />,

    children: [
      {
        id: "all",
        title: "Загальна",
        type: "item",
        url: "/digitalization/all",
        target: true,
      },
      {
        id: "cnap",
        title: "ЦНАП",
        type: "item",
        url: "/digitalization/cnap",
        target: true,
      },
      {
        id: "register3",
        title: "Register",
        type: "item",
        url: "/pages/register/register3",
        target: true,
      },
    ],
  },
  {
    id: "infrastructure",
    title: "Інфраструктура",
    type: "collapse",
    icon: <Apartment />,

    children: [
      {
        id: "all",
        title: "Загальна",
        type: "item",
        url: "/infrastructure/all",
        target: true,
      },
    ],
  },
  {
    id: "healthcare",
    title: "Охорона здоров'я",
    type: "collapse",
    icon: <MedicalServices />,

    children: [
      {
        id: "all",
        title: "Загальна",
        type: "item",
        url: "/healthcare/all",
        target: true,
      },
    ],
  },
  {
    id: "education",
    title: "Освіта",
    type: "collapse",
    icon: <School />,

    children: [
      {
        id: "all",
        title: "Загальна",
        type: "item",
        url: "/education/all",
        target: true,
      },
    ],
  },
  {
    id: "economy",
    title: "Економіка",
    type: "collapse",
    icon: <Assessment />,

    children: [
      {
        id: "all",
        title: "Загальна",
        type: "item",
        url: "/economy/all",
        target: true,
      },
    ],
  },
];

export default pages;
